import React, { Component } from 'react';
import { BrowserRouter, Switch, Route, Redirect } from 'react-router-dom'
import logo from './logo.svg';
import './Profile.css';

class Profile extends Component {
  constructor(props) {
    super(props);

    this.state = {
      toReward: false
    }
    this.routeChange = this.routeChange.bind(this);
  }

  routeChange() {
    this.setState({toReward: true});
  }

  render() {
    if (this.state.toReward === true){
      return (
        <Redirect to="/reward" />
      );
    }
    return (
      <div className = "container">
  <div className = "top-bar">
  <div className = "bar">
    <div className = "menu"></div>
    <div className = "menu"></div>
    <div className = "menu"></div>
  </div>
</div>

  <div className = "user">
    <div id = "circle"></div>
    <div id = "name"> Sam </div>
  </div>

  <table>
    <tbody>
      <tr id = "header">
          <td>
            <div className = "header-box">
            <p> My Medications </p>
            <img  src={require("./images/editicon.png")}
            alt="edit" width="20" height="20"/>
            </div>
          </td>
      </tr>
  <tr>
      <td>
        <div className = "row-box">
          <div className="medicine">
          <img  src={require("./images/stolen.png")}
          alt="pill" width="40" height="40"/>
            <p> Medicine #1</p>
        </div>
        <div className = "medicine-info">
          <p> Lorem ipsum dolor sit amet, consectetur adipiscing elit.
            Suspendisse ante odio, egestas vel mi nec, vulputate. </p>
        </div>
        </div>
      </td>
  </tr>
  <tr>
      <td>
        <div className = "row-box">
            <div className = "medicine">
            <img  src={require("./images/stolen.png")}
            alt="pill" width="40" height="40"/>
            <p> Medicine #2 </p>
            </div>
        <div className = "medicine-info">
          <p> Lorem ipsum dolor sit amet, consectetur adipiscing elit.
            Suspendisse ante odio, egestas vel mi nec. </p>
        </div>
        </div>

      </td>
  </tr>
  </tbody>
  </table>

  <div className = "reward" onClick = {this.routeChange}>
    <div className= "inner">
    <img
    src={require("./images/reward.png")} alt="icecweam"
    width="70" height="70"/>
      <p> Set a reward </p>
    </div>
  </div>

</div>
    );
  }
}

export default Profile;
